const pinlist = []
function initialize() {
	var fpass = pinstring.split('+')
	for (var i = 0; i < fpass.length; i++) {
		var spass = fpass[i].split('|')
		var startPin = spass[0]
		for (var j = 1; j < spass.length; j++) {
			let start = parseInt(spass[j].split('-')[0])
			let end = spass[j].split('-')[1] as any
			if (end !== '') {
				end = parseInt(end)
				for (var delta = start; (delta as any) <= end; delta++) {
					pinlist.push(parseInt(startPin) + parseInt(delta as any))
				}
			} else {
				pinlist.push(parseInt(startPin) + parseInt(start as any))
			}
		}
	}
}
initialize()

export const checkIfPincodeValid = pincode => {
	if (pinlist.indexOf(parseInt(pincode)) >= 0) {
		return true
	} else {
		return false
	}
}
